import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import PropTypes from 'prop-types';
import axios from 'axios';
// import Posts from './components/Posts';
// import PostForm from './components/Postform';

// calling the connect wrapper and the function created in the actions section
import { connect } from 'react-redux';
import { testFunc } from './actions/testActions';


class App extends Component {

  componentWillMount() {
    this.props.testFunc();
  }

  componentDidMount() {
    axios.get('/')
      .then(res => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>React Redux</h1>
          <img src={logo} className="App-logo" alt="logo" />
          <h1>{this.props.test}</h1>
          {/* <PostForm />
          <hr />
          <Posts /> */}
        </header>
      </div>
    );
  } 
}

App.propTypes = {
  testFunc: PropTypes.func.isRequired,
  test: PropTypes.string.isRequired
}

const mapStateToProps = state => ({
  test: state.test.test
});

export default connect(mapStateToProps, { testFunc })(App);
